import React, { Fragment } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

function Card(props) {
  const { name, address, info } = props;

  return (
    <div
      style={{
        color: "black",
        background: "lightgrey",
        padding: "15px 10px",
        display: "flex-direction: column",
        textAlign: "left",
        alignItems: "center",
        justifyContent: "left",
        borderRadius: "10px",
        transform: "translate(-50%, -50%)",
      }}
    >
      <p>{props.name}</p>
      <p>{props.address}</p>
      <p>{props.info}</p>
    </div>
  );
}

export default Card;
